import React from 'react'
import {Link} from 'react-router-dom'
export default function Button({product}) {
  return (
<div className='row_btn'>
    <Link to="#!" id='btn_buy'>Buy</Link>
    <Link  to={`/details/${product._id}`} id='btn_view'>View</Link>
</div>
  )
}
